//import logo from "./logo.svg";
import "./App.css";
import * as React from "react";
import CssBaseline from "@mui/material/CssBaseline";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import GridPage from "./components/GridPageContents/GridPage";
import TwentyQ from "./components/TwentyQ/TwentyQ";
import Account from "./components/Account/Account";
import Movie from "./components/MovieDetail/Movie"
function App() {
  return (
    <div className="App">
      <link
        rel="stylesheet"
        href="https://fonts.googleapis.com/css?family=Roboto:300,400,500,700&display=swap"
      />
      <link
        rel="stylesheet"
        href="https://fonts.googleapis.com/icon?family=Material+Icons"
      />
      <header className="App-header">
        <CssBaseline enableColorScheme />

        <BrowserRouter>
          <Routes>
            <Route path="/" element={<GridPage />} />
            <Route path="movieList" element={<GridPage />} />
            <Route path="twentyQ" element={<TwentyQ />} />
            <Route path="account" element={<Account />} />
            <Route path="/movie/:id" element={<Movie />} />
          </Routes>
        </BrowserRouter>
      </header>
    </div>
  );
}

export default App;
